CREATE PROCEDURE dbo.proc_transform_442
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_442
    SET payload = LEFT(payload, 1000) + N'|V4-442|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_442;
END
